import React from 'react';



import "./style.scss"


import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";

import BodyHomepage from "./Components/BodyHomepage"




export default function OurRoutes() {
  return (
    <Router>
      <div>
        <nav>
          <ul>
            <li>
              <Link to="/">Home</Link>
            </li>
            <li>
              <Link to="/about">About Us</Link>
            </li>
            <li>
              <Link to="/users">Contact Us</Link>
            </li>
          </ul>
        </nav>

        <BodyHomepage />

        {/* A <Switch> looks through its children <Route>s and
            renders the first one that matches the current URL. */}
        <Switch>
          <Route path="/about">
            <About />
          </Route>
          <Route path="/users">
            <Users />
          </Route>
          <Route path="/">
            <Home />
          </Route>
          <Route path="*" component={BodyHomepage}>
            <BodyHomepage />
          </Route >
        </Switch>
      </div>
    </Router>
  );
}

function Home() {
  return <div>
    <h2>Home</h2>
    <BodyHomepage />
        </div>

}

function About() {
  return <h2>About</h2>;
}

function Users() {
  return <h2>Users</h2>;
}
